// import App from '../App.js';

const Header = (props) => {

    return(
        <div classname="header">
            <div className="score">{props.score}</div>
            <div className="highScore">{props.highScore}</div>
            <div className="reset">{props.reset}</div>

        </div>
    )
}

export default Header;
